$(document).ready(function(){
  var cost = document.getElementById('cost').getAttribute('value');
  $('#order_rental_period').on('change',function() {
    var hours = document.getElementById('order_rental_period').value;
    document.getElementById('cost').innerHTML = cost * hours;
  });

  $('#myModalBooking').submit(function(){
    cost = $('#cost').text();
    $.ajax({
      type: 'post',
      url: 'orders',
      data: {rental_costs: cost}
    });
  });
})
